    try {
        const { ejercicio_id } = req.params;
        const connection = await getConnection();
        const result = await connection.query("DELETE FROM ejercicio WHERE ejercicio_id = ?", ejercicio_id);
        console.log(result);
        res.json(result);
    } catch(error) {
        res.status(500);
        res.send(error.message);
    }    
};

export const methods = {
    getEjercicios,
    getEjercicio,
    addEjercicios,
    deleteEjercicio,
    updateEjercicio
};

